const defaultState = {
   command: ''
}

const commandReducer = (state=defaultState, action) => {
   console.log("Going through commandReducer...")
   switch (action.type) {
      case 'UPDATE_COMMAND':
         console.log('UPDATE COMMAND')
         return {command: action.command}
      case 'SUBMIT_COMMAND':
         console.log('SUBMIT COMMAND')
         return {command: action.command}
      default:
         console.log('Returned default state from commandReducer.js')
         return state
   }
}

export default commandReducer
